package RunTimePractice;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;

public class RunTimePractice {

    public static int findNumsOfRepetitions(String s, char c){
        int sum = 0;
        for (int i = 0; i < s.length(); i++){
            if (s.charAt(i) == c){
                sum += 1;
            }
        }
        return sum;
    }

    public static int[] findNumsOfRepetitionsv1(String s, char[] c){
       int[] sums = new int[c.length];
       for (int i = 0; i < s.length(); i++){
           for (int j = 0; j < c.length; j++){
                if (s.charAt(i) == c[j]){
                    sums[j] = sums[j] + 1;
                }
           }
       }
        return sums;
    }

    public static int[] findNumsOfRepetitionsv2(String s, char[] c){
        int[] sums = new int[c.length];
        HashMap<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++){
            if (!map.containsKey(s.charAt(i))){
                map.put(s.charAt(i), 1);
            }else{
                int sum = map.get(s.charAt(i));
                map.put(s.charAt(i), sum+1);
            }
        }

        for (int j = 0; j < c.length; j++){
            int sum = 0;
            if (map.containsKey(c[j])){
                sums[j] = 0;
            }else{
                sums[j] = map.get(c[j]);
            }
        }
        return sums;
    }


    public static void main(String[] args) {

        long startTime = System.currentTimeMillis();
        System.out.println(findNumsOfRepetitions("",'a'));
        long endTime = System.currentTimeMillis();
        long duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");

        char[] a = {'a', 'b'};
        startTime = System.currentTimeMillis();
        System.out.println(Arrays.toString(findNumsOfRepetitionsv1("", a)));
        endTime = System.currentTimeMillis();
        duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");



        startTime = System.currentTimeMillis();
        System.out.println(Arrays.toString(findNumsOfRepetitionsv2("", a)));
        endTime = System.currentTimeMillis();
        duration = endTime - startTime;
        System.out.println("Test " + duration + " ms");

    }
}
